import React from "react";



const Topsectionbtn = () => {
    return (

        <div className="link-container">

            <div className="link">
                <a href="#about" data-scroll>About Me</a>  
            </div>

            <div className="link">
                <a href="#projects" data scroll>Projects</a> 
            </div>

        </div>
    )
}

export default Topsectionbtn;
